import React, { useState } from 'react';
import Navbar from '../components/Navbar';
import { motion } from 'framer-motion';
import Papa from 'papaparse'; // Import PapaParse for CSV parsing

const WhatWeDeliver = () => {
  const [csvData, setCsvData] = useState([]);
  const [csvHeaders, setCsvHeaders] = useState([]);

  const handleFileUpload = (event) => {
    const file = event.target.files[0];
    if (file) {
      Papa.parse(file, {
        header: true, // Assuming the first row contains headers
        dynamicTyping: true, // Attempt to convert column values to appropriate types
        skipEmptyLines: true,
        complete: function(results) {
          setCsvHeaders(Object.keys(results.data[0] || {})); // Get headers from the first data row
          setCsvData(results.data);
        }
      });
    }
  };

  return (
    <div className="min-h-screen animate-slideIn">
      {/* First Section - Dark Blue */}
      <section className="relative min-h-screen bg-[#070c24] flex flex-col items-center justify-center">
        <Navbar />
        <div className="container mx-auto px-4 pt-20">
          <h1 className="text-4xl md:text-6xl text-white font-bold mb-6">
            What We Deliver
          </h1>
          <p className="text-white/80 text-lg md:text-xl max-w-2xl">
            Explore our comprehensive solutions and deliverables that drive success.
          </p>
        </div>

        <div className="absolute left-1/2 bottom-1 -translate-x-1/2 flex flex-col items-center gap-2">
          <div className="w-[1px] h-24 bg-white/20 relative overflow-hidden">
            <motion.div
              className="w-full h-full bg-white"
              animate={{
                y: ['-100%', '100%'],
              }}
              transition={{
                repeat: Infinity,
                duration: 1.5,
                ease: 'linear',
              }}
            />
          </div>
        </div>
      </section>

      {/* Second Section - White */}
      <section className="min-h-screen bg-white py-16">
        <div className="container mx-auto px-4">
          
          

          {/* --- CSV File Section --- */}
          <div className="mt-16">
            <div className="bg-gray-100 p-6 rounded-lg shadow-md mb-8">
              <h3 className="text-2xl text-gray-800 font-semibold mb-4" style={{ fontSize: '20px' }}>
                CSV File
              </h3>
              <p className="text-gray-700 mb-6">Upload a CSV file to view its contents in a structured table below.</p>
              <input
                type="file"
                accept=".csv"
                onChange={handleFileUpload}
                className="hidden"
                id="csv-upload-button"
              />
              <label
                htmlFor="csv-upload-button"
                className="inline-block bg-blue-600 hover:bg-blue-700 text-white font-bold py-3 px-6 rounded-lg cursor-pointer transition duration-300 ease-in-out shadow-lg"
              >
                Upload CSV File
              </label>
            </div>

            {csvData.length > 0 && (
              <div className="overflow-x-auto bg-white p-6 rounded-lg shadow-md">
                <h3 className="text-xl text-gray-800 font-semibold mb-4">CSV File Contents</h3>
                <table className="min-w-full divide-y divide-gray-200">
                  <thead className="bg-gray-50">
                    <tr>
                      {csvHeaders.map((header, index) => (
                        <th
                          key={index}
                          scope="col"
                          className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider"
                        >
                          {header}
                        </th>
                      ))}
                    </tr>
                  </thead>
                  <tbody className="bg-white divide-y divide-gray-200">
                    {csvData.map((row, rowIndex) => (
                      <tr key={rowIndex}>
                        {csvHeaders.map((header, colIndex) => (
                          <td
                            key={colIndex}
                            className="px-6 py-4 whitespace-nowrap text-sm text-gray-900"
                          >
                            {row[header]}
                          </td>
                        ))}
                      </tr>
                    ))}
                  </tbody>
                </table>
              </div>
            )}
          </div>
        </div>
      </section>
    </div>
  );
};

export default WhatWeDeliver;
